### 다중 선형 회귀
y_pred = w1*x1+w2*x2+w3*x3+b
"""

import torch
import torch.nn as nn
import torch.nn.functional as F

from torch.utils.data import TensorDataset, DataLoader

"""### 1. 다중 선형 회귀를 위한 데이터 & 데이터로더 생성"""

x_train  =  torch.FloatTensor([[73,  80,  75], 
                               [93,  88,  93], 
                               [89,  91,  90], 
                               [96,  98,  100],   
                               [73,  66,  70]])  
y_train  =  torch.FloatTensor([[152],  [185],  [180],  [196],  [142]])

# 데이터셋에 넣어서 데이터 로더 사용
dataset = TensorDataset(x_train, y_train)

# 데이터 로더를 통해서 원하는 형태로 데이터를 공급 받는다.
BATCH_SIZE = 2

# DataLoader는 잘 섞어서 batch_size만큼씩 끊어서 데이터를 공급해준다.
dataloader = DataLoader(dataset, batch_size=BATCH_SIZE, shuffle=True)

"""![스크린샷 2022-09-16 오후 10.01.52.png](data:image/png;base64,)

### 2. 모델 선언
"""

model = nn.Linear(3,1)

LR = 1e-5  # 10의 마이너스 5승
optimizer = torch.optim.SGD(model.parameters(), lr=LR)

epochs = 40
for epoch in range(epochs+1):
    # 전체 훈련 데이터는 5개인데 batch_size=2이므로 2,2,1개 -> 1 epoch
    for batch_idx, samples in enumerate(dataloader):
        x_train, y_train = samples
        y_pred = model(x_train)

        Loss = F.mse_loss(y_pred, y_train)

        optimizer.zero_grad()
        Loss.backward()
        optimizer.step()

        if epoch%5==0:
            print('Epoch {:4d}/{} Batch {}/{} Loss: {:.6f}'.format(
            epoch, epochs, batch_idx+1, len(dataloader),
            Loss.item()))

